def carParkingRoof(cars, k)
    cars.sort!

    left = 0
    right = k - 1

    res = Float::INFINITY

    while right < cars.length
        roof_len = cars[right] - cars[left] + 1
        res = roof_len if res > roof_len

        left += 1
        right += 1
    end

    res
end


